import { useState } from 'react'
import wiseApi from 'wise-api'
import { createRoom, joinRoom } from './service'
import { config } from './config'

const styles = {
  container: {
    minHeight: '100vh',
    minWidth: '100vw',
    width: '100vw',
    height: '100vh',
    position: 'fixed' as const,
    top: 0,
    left: 0,
    display: 'flex',
    flexDirection: 'column' as const,
    alignItems: 'center',
    justifyContent: 'center',
    background: 'linear-gradient(135deg, #e0e7ff 0%, #f8fafc 100%)',
    fontFamily: 'Inter, Arial, sans-serif',
    padding: 0,
    zIndex: 1,
  },
  card: {
    background: '#fff',
    borderRadius: 16,
    boxShadow: '0 4px 24px rgba(0,0,0,0.08)',
    padding: 32,
    marginBottom: 32,
    minWidth: 340,
    textAlign: 'center' as const,
  },
  form: {
    display: 'flex',
    flexDirection: 'column' as const,
    gap: 16,
    alignItems: 'center',
    background: '#fff',
    borderRadius: 16,
    boxShadow: '0 4px 24px rgba(0,0,0,0.08)',
    padding: 32,
    minWidth: 340,
  },
  input: {
    padding: '10px 14px',
    borderRadius: 8,
    border: '1px solid #cbd5e1',
    fontSize: 16,
    width: 220,
    outline: 'none',
    transition: 'border 0.2s',
  },
  button: {
    padding: '10px 24px',
    borderRadius: 8,
    border: 'none',
    background: 'linear-gradient(90deg, #6366f1 0%, #60a5fa 100%)',
    color: '#fff',
    fontWeight: 600,
    fontSize: 16,
    cursor: 'pointer',
    margin: '0 4px',
    boxShadow: '0 2px 8px rgba(99,102,241,0.08)',
    transition: 'background 0.2s',
  },
  buttonDisabled: {
    background: '#cbd5e1',
    color: '#fff',
    cursor: 'not-allowed',
  },
  label: {
    display: 'flex',
    alignItems: 'center',
    gap: 8,
    fontSize: 15,
    color: '#334155',
  },
  message: {
    marginTop: 12,
    fontSize: 15,
  },
}

function App() {
  const [room, setRoom] = useState('')
  const [firstName, setFirstName] = useState('')
  const [lastName, setLastName] = useState('')
  const [moderator, setModerator] = useState(false)
  const [loading, setLoading] = useState(false)
  const [error, setError] = useState('')
  const [success, setSuccess] = useState('')

  const handlerClose = async () => {
    const apiInstance = await wiseApi({
      baseUrl: config.api.baseUrl,
      domain: config.api.domain,
    });
    console.log(apiInstance);
    await apiInstance.session.stopConference()
  }

  const handleCreate = async () => {
    setLoading(true)
    setError('')
    setSuccess('')
    try {
      const res = await createRoom()
      const newRoom = res.data.room || ''
      setRoom(newRoom)
      setSuccess('Sala criada com sucesso!')
    } catch {
      setError('Erro ao criar sala')
    } finally {
      setLoading(false)
    }
  }

  const handleJoin = async () => {
    setLoading(true)
    setError('')
    setSuccess('')
    try {
      const response = await joinRoom({ room, firstName, lastName, moderator })
      setSuccess('Entrou na sala com sucesso!')

      const apiInstance = await wiseApi({
        baseUrl: config.api.baseUrl,
        domain: config.api.domain,
      });

      await apiInstance.session.startConference(response.data.sessionId, {
        sessionToken: response.data.sessionToken,
        parentNode: document.getElementById('meet'),
        startWithVideoMuted: true,
        startWithAudioMuted: true,
        width: 640,
        height: 480,
        moderator: moderator,
        recording: false,
        onClose: () => { console.log('onClose') },
        onError: (event) => { console.log('onError', event) },
        onLoad: () => { console.log('onLoad') },
        onModeratorReject: () => { console.log('onModeratorReject') },
        onParticipantLeft: () => { console.log('onParticipantLeft') },
        // userInfo: { displayName: 'teste', avatarUrl: 'data:image/png;base64,' },
        shareLink: 'https://v4h.cloud/teste',
        buttons: [
          'camera',
          'chat',
          'desktop',
          'download',
          'embedmeeting',
          'etherpad',
          'feedback',
          'filmstrip',
          'fullscreen',
          'hangup',
          'help',
          'highlight',
          'invite',
          'linktosalesforce',
          'livestreaming',
          'microphone',
          'noisesuppression',
          'participants-pane',
          'profile',
          'raisehand',
          'security',
          'select-background',
          'settings',
          'shareaudio',
          'sharedvideo',
          'shortcuts',
          'stats',
          'tileview',
          'toggle-camera',
          'videoquality',
          'libras'
        ],
      });
    } catch {
      setError('Erro ao entrar na sala')
    } finally {
      setLoading(false)
    }
  }

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h1 style={{ color: '#6366f1', marginBottom: 8 }}>WiseAPI</h1>
        <p style={{ color: '#64748b', fontSize: 16, margin: 0 }}>Exemplo de uso da WiseAPI</p>
      </div>
      <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'flex-start', justifyContent: 'center', width: '100%' }}>
        <form style={styles.form} onSubmit={e => { e.preventDefault(); handleJoin(); }}>
          <div style={{ display: 'flex', gap: 8, width: '100%', justifyContent: 'center' }}>
            <button
              type="button"
              onClick={handleCreate}
              disabled={loading}
              style={loading ? { ...styles.button, ...styles.buttonDisabled } : styles.button}
            >
              Criar Sala
            </button>
            <input
              type="text"
              placeholder="Nome da sala"
              value={room}
              onChange={e => setRoom(e.target.value)}
              style={styles.input}
              autoComplete="off"
            />
          </div>
          <input
            type="text"
            placeholder="Primeiro nome"
            value={firstName}
            onChange={e => setFirstName(e.target.value)}
            style={styles.input}
            autoComplete="off"
          />
          <input
            type="text"
            placeholder="ltimo nome"
            value={lastName}
            onChange={e => setLastName(e.target.value)}
            style={styles.input}
            autoComplete="off"
          />
          <label style={styles.label}>
            <input
              type="checkbox"
              checked={moderator}
              onChange={e => setModerator(e.target.checked)}
            /> Moderador
          </label>
          <button
            type="button"
            onClick={handlerClose}
            style={{
              ...styles.button,
              background: 'linear-gradient(90deg, #ef4444 0%, #dc2626 100%)',
            }}
          >
            Encerrar Conferncia
          </button>
          <button
            type="submit"
            disabled={loading || !room || !firstName || !lastName}
            style={loading || !room || !firstName || !lastName ? { ...styles.button, ...styles.buttonDisabled } : styles.button}
          >
            Entrar na Sala
          </button>
          {loading && <p style={{ ...styles.message, color: '#6366f1' }}>Carregando...</p>}
          {error && <p style={{ ...styles.message, color: 'red' }}>{error}</p>}
          {success && <p style={{ ...styles.message, color: 'green' }}>{success}</p>}
        </form>
        <div id="meet"
          style={{
            minWidth: 600,
            minHeight: 400,
            width: 640,
            height: 480,
            marginLeft: 32,
            background: '#f1f5f9',
            borderRadius: 16,
            boxShadow: '0 4px 24px rgba(0,0,0,0.08)',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
          }}
        />
      </div>
    </div>
  )
}

export default App
